import React from "react";
import { StyleSheet, View, Image, TextInput, Button } from "react-native";

import Header from "../components/Header";
import TopNavigation from "../components/TopNavigation";

const BLUE = "#2C98F0";
const GRAY = ("#ffffff", 42);

const Login = (props) => {
  return (
    <View style={styles.container}>
      <Header title={props.title} />
      <TopNavigation />
      <Image
        source={require("../assets/client-logo.png")}
        style={styles.logo}
      />
      <TextInput
        nativeID="user"
        textAlign="left"
        placeholder="Email/Phone"
        sectionColor={"#2C98F0"}
        underlineColorAndroid={GRAY}
        style={styles.user}
        onChangeText={props.enterEmail}
        value={props.loginEmail}
      />
      <TextInput
        nativeID="password"
        textAlign="left"
        placeholder="Password"
        sectionColor={"#2C98F0"}
        underlineColorAndroid={GRAY}
        style={styles.passsword}
      />
      <Button title={"LOGIN"} style={styles.login} />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#fff",
  },

  logo: {
    width: 244,
    height: 60,
    alignSelf: "center",
    top: 80,
  },

  user: {
    width: 328,
    height: 45,
    alignSelf: "center",
    top: 100,
    fontSize: 16,
    fontFamily: "Roboto",
    paddingLeft: 6,
  },

  passsword: {
    width: 328,
    height: 45,
    alignSelf: "center",
    top: 140,
    fontSize: 16,
    fontFamily: "Roboto",
    paddingLeft: 6,
  },

  login: {
    top: 190,
    alignItems: "center",
    backgroundColor: "#23395D",
    width: 320,
    height: 53,
    alignSelf: "center",
  },
});

export default Login;
